import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { IconDefinitions, twitterIconDefinition } from "./NavbarData";
import "./Navbar.css"
import {
    IconLookup,
    IconDefinition,
    findIconDefinition
  } from '@fortawesome/fontawesome-svg-core'

import {faTwitter} from '@fortawesome/free-brands-svg-icons';

type ElementData = {
    icon: IconDefinition,
    label: string
}

const Navbar = (): React.ReactElement => {
    return (
        <div>
            <NavbarHeader />
            <ul>
            {IconDefinitions.map(iconDefinition => (
                <NavbarElement icon={iconDefinition.icon} label={iconDefinition.label} />
            ))
            }
            </ul>
        </div>
    )
};

const NavbarHeader = () => {
    return (
        <div>
            <FontAwesomeIcon icon={faTwitter} />
        </div>
    )
}

const NavbarElement = ({icon, label}: ElementData): React.ReactElement => {
    return (
        <li className="navbar-element">
            <p><a href="/"><span className="icon"><FontAwesomeIcon icon={icon} /></span> &nbsp;{label}</a></p>
        </li>
    )
}

export default Navbar;
